package com.scanchex.bo;

public class SCTicketExtraInfo {

	public String serviceId;
	public String model;
	public String description;
	public String status;
	public String ticketServiceId;
	public String time;
	public SCTicketExtraInfo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getServiceId() {
		return serviceId;
	}
	public void setServiceId(String serviceId) {
		this.serviceId = serviceId;
	}
	public String getModel() {
		return model;
	}
	public void setModel(String model) {
		this.model = model;
	}
	public String getDescription() {
		return description;
	}
	public void setDescription(String description) {
		this.description = description;
	}
	public String getStatus() {
		return status;
	}
	public void setStatus(String status) {
		this.status = status;
	}
	public String getTicketServiceId() {
		return ticketServiceId;
	}
	public void setTicketServiceId(String ticketServiceId) {
		this.ticketServiceId = ticketServiceId;
	}
	public String getTime() {
		return time;
	}
	public void setTime(String time) {
		this.time = time;
	}
	
	
}
